import React from 'react';
import './App.css';
import Home from './pages/Home'
import { BrowserRouter as Router, Switch, Route, Link} from "react-router-dom";

function App() {
  return (
    <div className="app">

      <Router>
        <switch>
          <Router path='/search'>
            <h1>A search page</h1>

          </Router>
          <Router path='/'>
            <Home />
          </Router>

        </switch>
      </Router>

    </div>
  );
}

export default App;
